import axios from 'axios';
import React from 'react'
import './Pages.css';

class OurCoaches extends React.Component {

    constructor(props){
        super(props);
        this.state = 
        {
            Coach: [],
        }
    }

    FetchCoaches() {
        axios.get("http://localhost:8080/coach/getCoach")
        .then((res) => {
            this.setState({
                Coach: res.data
            })
        });
    }

    componentDidMount(){
        this.FetchCoaches();
    }

    render() {
    return (
        <div className='coaches'>
            <div className='coaches-container'>
                <h1>GoForFit Coaches:</h1>
                <br/>
                <p>{this.state.Coach.firstName}</p>
                {this.state.Coach.map(coach => {
                    <p>Name: {coach.firstName} {coach.lastName}</p>
